import React, { Component } from "react";
import Layout from "../components/Layout";
import { Segment, Header, Image, List } from "semantic-ui-react";

class index extends Component {
  render() {
    return (
      <Layout>
        <Segment
          style={{
            margin: "",
            backgroundColor: "black",
            padding: "10% 0 10% 0",
            width: "100%",
          }}
        >
          <List inverted>
            <List.Item>
              <Header
                textAlign="center"
                as="h1"
                content="SECURITY IN YOUR HANDS"
              />
            </List.Item>
            <List.Icon>
              {/* <Header floated="right" as="h3" inverted icon="lock" /> */}
            </List.Icon>
          </List>
        </Segment>
      </Layout>
    );
  }
}

export default index;
